import { Button } from "@mui/material";
import postcss from "postcss";
import React, { useEffect, useState } from "react";
import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";
import { Paginacao } from "./Paginacao";

function PaginaInicial( { postPerPage1 , totalPosts } ) {

    const navigate = useNavigate();

    const [usuarios, setUsuarios] = useState('');
    const [loading, setLoading] = useState(true);
    const [currrentPage, setCurrentPage] = useState(1)
    const [postPerPage, setPostPerPage] = useState(5);

    useEffect(()=>{
        fetch("http://localhost:8080/usuario/getAll?page0&size2")
        .then( res => res.json())
        .then((resultado)=>{
            if(resultado != null){
                setLoading(false);
                setUsuarios(resultado)
            }
        })
    },[])

    /* Paginação */
    const lastIndex = currrentPage * postPerPage;
    const firstIndex = lastIndex - postPerPage;
    const currentIndex = usuarios.slice(firstIndex, lastIndex)

    const numeroPaginas = [];

    for(let i=1 ; i<= Math.ceil(totalPosts/postPerPage1); i++){
        numeroPaginas.push(i)

    }

  return (
    <div>
        { loading && <div> Carregando </div>}
      {/* ------------------------------- Lista e busca ------------------------------------------ */}
    { !loading && <div className="flex flex-col mx-32">
    <div className="overflow-x-auto">
        <div className="py-3 pl-2 flex justify-between">
            <div className="relative max-w-xs">
                <label htmlFor="hs-table-search" className="sr-only">
                    Search
                </label>
                <input
                    type="text"
                    name="hs-table-search"
                    id="hs-table-search"
                    className="block w-full p-3 pl-16 text-sm border-gray-200 rounded-md focus:border-blue-500 focus:ring-blue-500 bg-gray-200"
                    placeholder="Search..."
                />
                <div className="absolute inset-y-0 left-0 flex items-center pl-4 pointer-events-none">
                    <svg
                        className="h-3.5 w-3.5 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        width="16"
                        height="16"
                        fill="currentColor"
                        viewBox="0 0 16 16"
                    >
                        <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0z" />
                    </svg>
                </div>
            </div>
            <div> 
                <Link to="/novoCadastro" className="px-3 py-2 bg-cyan-700 hover:bg-cyan-900 rounded-md text-white text-sm mr-2 font-se">
                        Cadastrar Novo Usuário
                </Link>
            </div>
        </div>

        <div className="p-1.5 w-full inline-block align-middle">
            <div className="overflow-hidden border rounded-lg">
                <table className="min-w-full divide-y divide-gray-200">
                    <thead className="bg-gray-50">
                        <tr>
                            <th scope="col" className="flex items-center px-6 py-3 text-xs font-bold text-left text-gray-500 uppercase ">
                                ID
                            </th>
                            <th scope="col" className="px-6 py-3 text-xs font-bold text-left text-gray-500 uppercase ">
                               Nome
                            </th>
                            <th scope="col" className="px-6 py-3 text-xs font-bold text-right text-gray-500 uppercase ">
                                Detalhes
                            </th>
                        </tr>
                    </thead>
                   { currentIndex.map(usuario=>( <tbody className="divide-y divide-gray-200">
                        <tr  key={usuario.id}>
                            <td className="px-6 py-4 text-sm font-medium text-gray-800 text-start">
                                {usuario.id}
                            </td>
                            <td className="px-6 py-4 text-sm text-gray-800 text-start">
                                {usuario.nome}
                            </td>
                            <td className="px-6 py-4 text-sm font-medium text-right whitespace-nowrap">
                                <Button onClick={()=> navigate('/detalhes', { state: { usuario } })}>
                                    Detalhes
                                </Button>
                            </td>
                        </tr>
                    </tbody> ))} 
                </table>
                <div postPerPage={postPerPage1} totalPosts={usuarios.length}>
                <nav>
                        <ul className='Pagination'>
                            {numeroPaginas.map(numero=>(
                                <li key={numero} className="page-item">
                                    <a href='!#' className='page-link'>
                                        {numero}
                                    </a>
                                </li>
                            ))}
                        </ul>
                </nav>
                </div>
            </div>
        </div> 
    </div> 
</div>}
</div>
  );
}

export default PaginaInicial;
